import "bootstrap/dist/css/bootstrap.min.css";
import * as ReactBootStrap from "react-bootstrap";
import "./Navbar.css";

function NavBarComp() {

  const gotoIntro = () => {
    const cHeight = window.innerHeight +500;

    window.scrollTo(0, cHeight);
  }
  const gotoMywork = () => {
    const cHeight = window.innerHeight * 2 + 200;


    window.scrollTo(0, cHeight);
  }

  return (
    <div className='navbar'>
      <ReactBootStrap.Navbar
        className='color-nav'
        expand='lg'
        sticky='top'
        variant='dark'
      >
        <ReactBootStrap.Container>
          <ReactBootStrap.Navbar.Brand
            style={{ color: "lightskyblue" }}
          >
            YHN.DEV
          </ReactBootStrap.Navbar.Brand>
          <ReactBootStrap.Navbar.Toggle aria-controls='basic-navbar-nav' />
          <ReactBootStrap.Navbar.Collapse id='basic-navbar-nav'>
            <ReactBootStrap.Nav className='me-auto'>
              <ReactBootStrap.Nav.Link onClick={gotoIntro}>
                <span style={{ color: "#ccff15" }}>01.</span>Intro_
              </ReactBootStrap.Nav.Link>
              <ReactBootStrap.Nav.Link onClick={gotoMywork}>
                <span style={{ color: "#ccff15" }}>02.</span>My work_
              </ReactBootStrap.Nav.Link>
              <ReactBootStrap.NavDropdown title='Links' id='basic-nav-dropdown'>
                <ReactBootStrap.NavDropdown.Item href='https://www.fiverr.com/yhn_dev'>
                  Fiverr
                </ReactBootStrap.NavDropdown.Item>
                <ReactBootStrap.NavDropdown.Item href='https://www.linkedin.com/in/yohan-arejouane-62752b104/'>
                  LinkedIn
                </ReactBootStrap.NavDropdown.Item>
                <ReactBootStrap.NavDropdown.Item href='https://github.com/yohan2095'>
                  Github
                </ReactBootStrap.NavDropdown.Item>
                <ReactBootStrap.NavDropdown.Item href='https://www.instagram.com/yhn.dev/'>
                  Instagram
                </ReactBootStrap.NavDropdown.Item>
              </ReactBootStrap.NavDropdown>
            </ReactBootStrap.Nav>
          </ReactBootStrap.Navbar.Collapse>
        </ReactBootStrap.Container>
      </ReactBootStrap.Navbar>
    </div>
  );
}

export default NavBarComp;
